-- Sistemo i flag della presenza start-list
update meetings m set m.has_start_list = false;
update meetings m set m.has_start_list = true where (select count(me.id) from meeting_entries me join meeting_programs mp on mp.id = me.meeting_program_id join meeting_events mv on mv.id = mp.meeting_event_id join meeting_sessions ms on ms.id = mv.meeting_session_id where ms.meeting_id = m.id) > 100;

-- Sistemo i flag della presenza risultati
update meetings m set m.are_results_acquired = false;
update meetings m set m.are_results_acquired = true where (select count(mir.id) from meeting_individual_results mir join meeting_programs mp on mp.id = mir.meeting_program_id join meeting_events mv on mv.id = mp.meeting_event_id join meeting_sessions ms on ms.id = mv.meeting_session_id where ms.meeting_id = m.id) > 50;


